script: |
  super -f text -I q10289.spq | sort > q10289.out

inputs:
  - name: q10289.spq
    data: |
      SELECT DISTINCT 84 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 + + + 49 + + + 43 NOT BETWEEN + 95 * + col1 AND NULL;
  - name: tab1

outputs:
  - name: q10289.out
    data: |
      84
